(173908, '7DBBE26E-6CD7-4693-8078-502E36C4456F', 'Was a great night. I cooked for everyone (tri-tip, grilled eggplant, salad, and of course French fries. There was cheesecake for dessert). Hung out with my friend gary outside, ate outside. There was guitar playing and singing and boy Magic playing. Found out that nathan is the youngest ''pro'' magic player in the world. The game store wants to give him a contract to sponsor him. Pretty great. Feel mentally in a good place. Just really excited to be with you and ', 'David', 'Nitzan', '2015-08-12T23:36:20'),
